var fetch = require("node-fetch");

base64String = "";
fetchRes = fetch('https://strawberrydev6.loca.lt/api/data-strawberry', {
    method: 'POST',
    headers: {
        Accept: '*/*',
        'Content-Type': 'application/json',
    },
    body: JSON.stringify({
        "image": base64String
    }),
    mode: "cors",
});

fetchRes.then(res =>
    res.json()).then(d => {
    console.log(d)
})


